import React, { Fragment, useState } from 'react';
import PropTypes from 'prop-types';
import { Modal, ModalHeader, ModalBody } from 'reactstrap';

const setProfileImage = (props) => {
  // const [toggleDisplay, setToggleDisplay] = useState(false);
  State = {
    toggleDisplay: false,
  };

  return (
    <Fragment>
      <div>
        <button
          onClick={this.setState({ toggleDisplay: !toggleDisplay })}
          className='btn btn-success'
        >
          Click Me
        </button>
      </div>

      <Modal
        isOpen={this.toggleDisplay}
        toggle={this.setState({ toggleDisplay: !toggleDisplay })}
      >
        <ModalHeader>Header</ModalHeader>
        <ModalBody>Body</ModalBody>
      </Modal>
    </Fragment>
  );
};

setProfileImage.propTypes = {};

export default setProfileImage;
